import { useState } from "react";

function Square() {
  const [value, setValue] = useState(null);

  function handleClick() {
    if (value === null) {
      setValue("X");
    } else {
      setValue(null);
    }
  }

  return (
    <button className="square" onClick={handleClick}>
      {value}
    </button>
  );
}


export default Square;
